import React, { useState } from "react";

function CreatePage() {
    const [name, setName] = useState("");
    const [species, setSpecies] = useState("");

    const handleSubmit = (event) => {
        event.preventDefault();
        // Llama al método POST de FastAPI aquí con los datos del formulario
        console.log("Crear animal con nombre:", name, "y especie:", species);
    };

    return (
        <div style={pageStyle}>
            <h2>Create Animal</h2>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    placeholder="Nombre"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                />
                <input
                    type="text"
                    placeholder="Especie"
                    value={species}
                    onChange={(e) => setSpecies(e.target.value)}
                />
                <button type="submit">Crear</button>
            </form>
        </div>
    );
}

const pageStyle = {
    backgroundColor: "#ffffff",
    color: "#000000",
    padding: "2rem",
    borderRadius: "10px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
};

export default CreatePage;
